import React, {Component} from 'react';
import "./Page.css";
import Box from "./Box.js";
import CFC from "./cfc.png";
import MM from "./mmpics/mmdisplay.jpg";
import FW from "./FW.jpg";
import WB from "./web.png"
import WM from "./WomensDay/WD.jpg"
import SR from "./shareceipt.jpg"
import OM from "./omicron/OM-01.jpg"
import FY from './logo-cover/FYEER.png'
import IF from './logo-cover/infograph.png'
import PopUp2 from './CFC.js'
import PopUp3 from './Webmaster.js'
import PopUp1 from './FroshWeek.js'
import PopUp4 from './MinionMunch.js'
import PopUp5 from './WomensDay/WomensDay.js'
import PopUp6 from './OM.js'
import PopUp7 from './Shareceipt.js'

class Page extends Component {
    render(){
        return(
            <div id="body1">
            <h1 style={{padding:'15px'}} className='header'>Projects + Portfolio</h1>
                <div class="row rows" >
                    <Box 

                        src={MM}
                        name="Minion Munch"
                        type="Graphic Design"
                        pop={<PopUp4/>}

                    />
                    <Box 
                        src={CFC}
                        name="Cafes for Change"
                        type="Logo Design"
                        pop={<PopUp2/>}

                    />
                    <Box 
                        src={WM}
                        name="International Women's Day"
                        type="Graphic Design"
                        pop={<PopUp5/>}

                    />

                </div>
                <div class="row rows" >

                    <Box
                        src={OM}
                        name="Omicron"
                        type="UI Design"
                        pop={<PopUp6/>}

                    />
                    <Box
                        src={FY}
                        name="FYEER"
                        type="Logo Design"
                        pop={<PopUp6/>}

                    />
                     <Box
                        src={IF}
                        name="Infographic Posters"
                        type="Logo Design"
                        pop={<PopUp6/>}

                    />
                    </div>


               <div class="row rows" >

                <Box
                    src={WB}
                    name="campaigns.skule.ca"
                    type="UI/UX Design"
                    pop={<PopUp3/>}

                />
                <Box 
                        src={FW}
                        name ="Frosh Week"
                        type="Graphic Design"
                        pop={<PopUp1/>}                      
                    /> 
                <Box 
                        src={SR}
                        name ="Shareceipt"
                        type="UI/UX Design"
                        pop={<PopUp7/>}                      
                    /> 
            </div>

            </div>

        );
    }
}
export default Page;
